import React from "react";
import { NavLink, useHistory } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import LogoutButton from "../auth/LogoutButton";
import { demoLogin } from "../../store/session";

// MUI icons
import HomeIcon from "@mui/icons-material/Home";
import LocationOnIcon from "@mui/icons-material/LocationOn";

import "./NavBar.css";

const NavBar = () => {
  const user = useSelector((state) => state.session.user);
  const dispatch = useDispatch();
  const history = useHistory();

  const demoFunction = async (e) => {
    e.preventDefault();
    dispatch(demoLogin());
    history.push("/");
  };

  return (
    <nav className="nav_container">
      {user && (
        <div className="nav_item">
          <NavLink to="/" exact className="nav_link">
            <HomeIcon className="nav_icon" />
            <span>SteakOut</span>
          </NavLink>
        </div>
      )}

      {!user && (
        <>
          <div className="nav_item">
            <NavLink to="/login" exact className="nav_link">
              Login
            </NavLink>
          </div>
          <div className="nav_item">
            <NavLink to="/sign-up" exact className="nav_link">
              Sign Up
            </NavLink>
          </div>
          <button id="demo-button" onClick={demoFunction}>
            Demo
          </button>
        </>
      )}

      {user && (
        <>
          <div className="nav_item">
            <NavLink to={`/users/${user.id}`} exact className="nav_link">
              {`${user.username}'s Profile`}
            </NavLink>
          </div>

          <div className="nav_item">
            <NavLink to="/locations" exact className="nav_link">
              <LocationOnIcon className="nav_icon" />
              <span>Locations</span>
            </NavLink>
          </div>

          <div className="nav_item">
            <NavLink to={`/users/${user.id}/add-musician`} exact className="nav_link">
              Upload Musician
            </NavLink>
          </div>

          <div className="nav_item">
            <NavLink to="/musicians" exact className="nav_link">
              Musicians
            </NavLink>
          </div>

          <LogoutButton />
        </>
      )}
    </nav>
  );
};

export default NavBar;
